import React from 'react';
import { ExperienceItem } from '../../types';
import '../../styles/components/experience.css';

const Experience: React.FC = () => {
  const languages: ExperienceItem[] = [
    { icon: "./assets/checkmark.png", title: "Java", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "HTML/CSS", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "Racket", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "JavaScript", level: "Intermediate" },
    { icon: "./assets/checkmark.png", title: "Python", level: "Intermediate" },
    { icon: "./assets/checkmark.png", title: "SQL", level: "Intermediate" }
  ];

  const tools: ExperienceItem[] = [
    { icon: "./assets/checkmark.png", title: "React", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "Flask", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "Git", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "Microsoft Office", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "VS Code", level: "Experienced" },
    { icon: "./assets/checkmark.png", title: "Figma", level: "Experienced" }
  ];

  const ExperienceSection: React.FC<{ title: string, items: ExperienceItem[] }> = ({ title, items }) => (
    <div className="details-container">
      <h2 className="experience-sub-title">{title}</h2>
      <div className="article-container">
        {items.map((item, index) => (
          <article key={index}>
            <img
              src={item.icon}
              alt="Experience icon"
              className="icon"
              loading="lazy"
            />
            <div>
              <h3>{item.title}</h3>
              <p>{item.level}</p>
            </div>
          </article>
        ))}
      </div>
    </div>
  );

  return (
    <section id="experience">
      <p className="section__text__p1">Explore My</p>
      <h1 className="title">Experience</h1>
      <div className="experience-details-container">
        <div className="about-containers">
          <ExperienceSection title="Languages" items={languages} />
          <ExperienceSection title="Tools & Frameworks" items={tools} />
        </div>
      </div>
    </section>
  );
};

export default Experience;
